import PropTypes from "prop-types";
import {
  CardContent,
  CardMedia,
  Typography,
  Button,
  CardActionArea,
  CardActions,
} from "@mui/material";
import { MyCard } from "./PlacesCardStyles";

export default function PlacesCard({ place }) {
  return (
    <MyCard>
      <CardActionArea>

        <CardMedia
          component="img"
          height="140"
          image={place.strDrinkThumb}
          alt="stefania"
        />
        <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          {place.strDrink}
        </Typography>
        <Typography variant="caption" font-size="12px" color="text.secondary">
          {place.strInstructionsES}
        </Typography>
      </CardContent>
      </CardActionArea>
    </MyCard>
  );
}

PlacesCard.propTypes = {
  place: PropTypes.shape([]).isRequired,
};
